// Function to update progress bar based on current playback time
function updateProgressBar() {
    let progressBar = document.getElementById("progress-bar");
    let progress = (music.currentTime / music.duration) * 100;
    progressBar.value = progress;
}

// Function to handle progress bar click event
function handleProgressBarClick(event) {
    let progressBar = document.getElementById("progress-bar");
    let rect = progressBar.getBoundingClientRect();
    let x = event.clientX - rect.left;
    let width = progressBar.clientWidth;
    let progress = (x / width) * 100;
    music.currentTime = (progress / 100) * music.duration;
}

// Update progress bar continuously as the song plays
music.addEventListener("timeupdate", updateProgressBar);

// Add event listener for progress bar click
let progressBar = document.getElementById("progress-bar");
progressBar.addEventListener("click", handleProgressBarClick);

// Function to handle click event on the heart icon
document.getElementById("favourite").addEventListener("click", function () {
    let heartIcon = document.getElementById("favourite");
    let isFilled = heartIcon.classList.contains("fa-heart");

    // Get the index of the current song
    let currentIndex = parseInt(defaultsongname.parentElement.id);

    // Toggle between filled and outline heart icon
    if (isFilled) {
        heartIcon.classList.remove("fa-heart");
        heartIcon.classList.add("fa-heart-o");
        removeFromFavorites(currentIndex); // Remove song from favorites section and localStorage
    } else {
        heartIcon.classList.remove("fa-heart-o");
        heartIcon.classList.add("fa-heart");
        addToFavorites(currentIndex); // Add song to favorites section and localStorage
    }
});

